import React from 'react';

export default function TodoElement(props: any) {
  const { title, description } = props;
  return (
    <tr>
      <td>{title}</td>
      <td>{description}</td>
      <td>
        <button type="button">Action</button>
      </td>
    </tr>
  );
}
